import resvg_py
from pathlib import Path
import os
import base64

BASE_DIR = Path(__file__).resolve().parent

output_dict = {
    "multi_layer": ""
}


def test_multiple_layer_svg():
    path = BASE_DIR / "test.svg"

    # Convert SVG to bytes using resvg_py and base64 encode
    svg_bytes = resvg_py.svg_to_bytes(svg_path=str(path))
    base = base64.b64encode(svg_bytes).decode("utf-8")

    assert base == output_dict["multi_layer"]
